import React from 'react';
import MicroCard from "./MicroCard";

const FollowersColumn = (topFiveFollowing) => {

    let usersTemp = Object.entries(topFiveFollowing.users);
    let users = Object.keys(usersTemp)
        .filter(key => "topFiveFollowing".includes(key))
        .reduce((obj, key) => {
            obj[key] = raw[key];
            return obj;
        }, {});
    console.log(users);
    return (

        <div className="followers-column">
            <div className="followers-section">
                <div className="home" />
                <h2 className="bold red">For You</h2>
            </div>
            <div className="followers-section">
                <div className="following" />
                <h2>Following</h2>
            </div>
            <hr />
                <p>Your top accounts</p>
                {users && users.map((user, index) => (
                    <MicroCard
                        key={index} user={user}
                    />
                ))}
            <hr />
        </div>

    );

  }

  export default FollowersColumn;
